(2,4)\n    ) \nAS \nT(a, b);\nCREATE PROCEDURE testdb18768.dbo.testproc14026()\nAS BEGIN\n  CREATE VIEW testdb18768.dbo.testview13678 \n  AS \n    SELECT * FROM \n    (\n        VALUES(1,2),(2,4)\n    ) \n  AS \n  T(a, b);\nEND;",
